  if (resourceKey != null) {
    builder.setResourceKey(this.resourceKey);
  }
  if (localizationState != null) {
    builder.setLocalizationState(convertToProtoFormat(localizationState));
  }
  if (diagnostics != null) {
    builder.setDiagnostics(diagnostics);
